    {pet}) => {
    if(image.addImages){
        console.log(pet)
        console.log('oooooooooo')
    }
    console.log(image.pet.pet._)
    return (
        <Grid item xs={12} sm={6} lg={4}>
            {/* <img  src={image.src}/> */}
        </Grid>
    )
}

const mapStateToProps = state =>({
    pet: state.pets
})

